import React from 'react';
import './Footer.css'; // Assuming you have a CSS file for footer styles

const Footer = () => {
    return (
        <footer className="footer">
            <p>&copy; {new Date().getFullYear()} Marta Cuevas. Todos los derechos reservados.</p>
            <div className="footer-links">
                <a href="https://github.com/marta-cuevas" target="_blank" rel="noopener noreferrer">GitHub</a>
                <a href="https://www.linkedin.com/in/marta-cuevas" target="_blank" rel="noopener noreferrer">LinkedIn</a>
            </div>
        </footer>
    );
};

export default Footer;
